import { LiveboardEmbed, SearchEmbed, AuthType } from "@thoughtspot/visual-embed-sdk";

function IQVIA() {
    useEffect(() => {
        init({
            thoughtSpotHost: 'https://se-thoughtspot-cloud.thoughtspot.cloud/#/',
            authType: AuthType.None,
        });
    }, [])

    let tsVisible = false;

    return(
        <div style={{display:"flex"}}>
            <div style={{height:'100%',width:'100%',display:"flex",flexDirection:'column'}}>

                <div style={{height:'40px',width:'100%',display:"flex",flexDirection:'row', background:'#abcabc'}} >
                    Nice
                </div>
                <div style={{height:'100%',width:'100%',display:"flex",flexDirection:'row'}} >
                    <div style={{height:'100%',width:'250px',display:"flex",flexDirection:'column',background:'#ecefdd'}}>
                        this Dashboard
                    </div>                
                    <div style={{height:'100%',width:'100%',display:"flex",flexDirection:'row', background:'#cccccc'}}>
                        <SearchEmbed></SearchEmbed>
                    </div>
                </div>
            </div>
            {
                tsVisible ? 
                <div style={{position:'absolute', width:'70%', height:'70%'}}>
                    Thoughtspot Pop-up
                </div>
                : <div></div>
            }

        </div>
    )
}
export default IQVIA;
